<html>
<head>
	<style>
		html {
			background-color:#000000;
		}
		#page-wrapper-1 {
			height:100%;
			width:100%;
			position:fixed;
			top:0px;
			left:0px;
			opacity:1;
		}
		
		.row-container {
		  position: relative;
		  width:508px;
		  display: grid;
		  grid-template:  auto / auto auto auto auto;
		  grid-gap: 8px;
		  margin: 30px 30px 30px 550px;
		  padding: 0px;
		}
		.print-container {
			width:125px;

			border-radius:20px;
			overflow:hidden;
		}
		.year-label {
			font-size:72pt;
			padding:30px;
		}
		.print-thumb {
			width:125px;
		}
		#print-full img {
			width:500px;
		}
		#print-full {
			position:fixed;
			right:50%;
			top:30px;
			margin-right:30px;
			width:500px;
			min-height:500px;
			border-radius:20px;
			overflow:hidden;
    	  -webkit-transition: opacity 1s ease-out;
    	  -moz-transition: opacity 1s ease-out;
    	  -o-transition: opacity 1s ease-out;
    	  transition: opacity 1s ease-out;
		}
		html {
			touch-action: none!important;
		}
		.selected {
			width:105px;
			border:10px solid yellow;
			padding:-20px -20px -20px -20px!important;
		}
	</style>
<script>
	function loadImage(n) {
		document.getElementById("print-full").innerHTML = "<img src='images/thumb500-" + n + ".jpeg'/>";	
	}
	function loadPng(n) {
		document.getElementById("print-full").innerHTML = "<img src='" + n + "'/>";	
	}
</script>
	   
</head>
